INSERT INTO `videoinfo` VALUES ('00000000024', '哈尔滨旅游宣传片', '哈尔滨素来有着“东方小巴黎”、“东方莫斯科”的美名。市内建筑中西合壁，格调鲜明。人文历史悠久，不仅荟萃北方少数民族的历史文化，而且是中西文化结合的名城。庄严雄伟的圣索菲亚教堂，神秘气氛笼罩的尼古拉教堂，造型奇巧的俄罗斯木屋，典雅别致的歌特式楼宇，欧式建筑的中央大街，雅洁明快的建筑色调，灯红酒绿、繁华如锦的都市风貌，一年一度的“哈尔滨之夏”音乐会，“冰雪节”国际冰雕雪塑比赛，以及“国际经贸洽谈会”，处处折射出“东方莫斯科”的独特魅力。', 'zwh', '2017-12-25 08:59:42', , 'http://v.youku.com/v_show/id_XMzA1MzIwODg1Mg==.htmltpa=dW5pb25faWQ9MzAwMDAzXzEwMDAxNF8wNF8wMQ&fromvsogou=1');
INSERT INTO `videoinfo` VALUES ('00000000025', '哈尔滨旅游介绍', '哈尔滨中西合璧的城市风貌，粗犷豪放的北方民族风情，一道道亮丽的风景令人流连忘返，一年一度的哈尔滨之夏音乐会、冰灯游园会、冰雪大世界等大型活动显示了哈尔滨深厚的文化底蕴。龙塔、防洪纪念塔、文庙、极乐寺、圣索非亚教堂、俄罗斯风情的中央大街、萧红故居、金代上京会宁府等文物古迹和玉泉狩猎场、东北虎林园、亚布力滑雪旅游度假区、原始森林等500余处人文自然景观，与哈尔滨周边的镜泊湖、五大连池、扎龙自然保护区一起构成了中国北方别具一格的特色旅游地，凭藉这些优势，哈尔滨市1998年被国家旅游局评选为首批中国优秀旅游城市。', 'zwh', '2017-12-25 09:00:33', , 'http://video.tudou.com/v/XMjA2MDc3NjgxMg==.html');
INSERT INTO `videoinfo` VALUES ('00000000026', '冰城哈尔滨', '世界上，冬季漫长而寒冷，夏季温暖而短促，冰雪覆盖时间较长的城市很多，其中最有名的莫过于中国的哈尔滨和俄罗斯的雅库茨克。这些城市均号称“冰城”。', 'zwh', '2017-12-25 09:09:38', , 'http://v.youku.com/v_show/id_XMTY3NjE3NDczNg==.html');
INSERT INTO `videoinfo` VALUES ('00000000027', '哈尔滨旅游景点', '哈尔滨是中国著名的历史文化名城和旅游城市，拥有圣索非亚教堂等文物古迹和亚布力滑雪旅游度假区、原始森林等人文自然景观，每年还会有哈尔滨之夏音乐会、冰灯游园会、冰雪大世界等大型活动举行。同时，也是理想的避暑胜地。', 'zwh', '2017-12-25 09:05:12', , 'https://v.qq.com/x/page/h05467fsyw5.html?fromvsogou=1');
INSERT INTO `videoinfo` VALUES ('00000000028', '哈尔滨冰雪大世界', '中国哈尔滨冰雪大世界始创于1999年，是由哈尔滨市政府为迎接千年庆典神州世纪游活动，凭借哈尔滨的冰雪时节优势，而推出的大型冰雪艺术精品工程，展示了北方名城哈尔滨冰雪文化和冰雪旅游魅力。在冰雪大世界，您可以观赏到世界上最高、最美、最雄伟、最具魅力的冰雪奇观。', 'zwh', '2017-12-25 09:05:53', , 'https://v.qq.com/x/page/e03688fpiam.html?fromvsogou=1');
INSERT INTO `videoinfo` VALUES ('00000000030', '哈尔滨——龙塔', '龙塔，即黑龙江省广播电视塔，是东北第二大城市哈尔滨的标志性建筑。塔高336米， 									高度在钢塔中位于世界第十四，亚洲第九。是一座集广播电视发射、旅游观光、餐饮娱乐、广告传播、 									环境气象监测、微波通讯、无线通讯于一体的综合性多功能塔。', 'zwh', '2017-12-25 09:07:22', , 'http://video.tudou.com/v/XMjAxNzgzMTA4OA==.html');
